              <svg class="w-[250px] h-auto" viewBox="0 0 287 103" fill="none" xmlns="http://www.w3.org/2000/svg"
                xmlns:xlink="http://www.w3.org/1999/xlink">
                <rect width="287" height="103" fill="url(#pattern0_2421_357)" />
                <defs>
                  <pattern id="pattern0_2421_357" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use xlink:href="#image0_2421_357" transform="matrix(0.00112607 0 0 0.00334568 0 -1.168)" />
                  </pattern>
                  <image id="image0_2421_357" width="1000" height="1000"
                    xlink:href="data:image/png;base64," />
                </defs>
              </svg>

            </div>
          </div>
          <div class="pt-10">
            <h1 class="text-xl text-center font-bold">{{ $t('login.title') }}</h1>
